Pregnant? Just track your pregnancy week by week using Pregnancy App.

With Pregnancy App you can easily: 
- track your pregnancy;
- get information about your pregnancy;
- get current pregnancy week and use pregnancy calendar;
- calculate due date (pregnancy date);
- manage contractions with contraction counter
- track kicks with kick counter
- track your pregnancy weight

Pregnancy Tracker is very helpful for a pregnant woman.
Free pregnancy app. 
Powered by Amila.

Luxembourgish national mobile app to check EU Digital COVID Certificates - The app allows to check in real-time the authenticity and validity of documents issued in the context of the EU Digital COVID Certificate #EUCOVIDCertificate:
• certificate of recovery;
• vaccination certificate;
• test certificate.

The app allows users to:
• scan the QR code on the certificate;
• check the authenticity and the validity of the certificate.

Mini Clock, a cool flip-page full-screen clock.

